contratos.objeto:
INSTALAR NA SEÇÃO DE BIOQUÍMICA DOIS EQUIPAMENTOS TOTALMENTE AUTOMATIZADOS NOVOS, DA MESMA MARCA, QUE FAÇAM JUNTOS NO MÍNIMO 2.000 TESTES POR HORA COM O ISE. OS EQUIPAMENTOS DEVEM TER AS SEGUINTES CARACTERÍSTICAS:
TER SISTEMA PARA TUBO PRIMÁRIO;
DISPOR DE MÓDULO ISE PARA SÓDIO, POTÁSSIO E CLORO;
LIBERAR OS ÍNDICES SÉRICOS DE TODAS AS AMOSTRAS;
REALIZAR PRÉ-DILUIÇÃO E PÓS-DILUIÇÃO AUTOMÁTICA DAS AMOSTRAS;
TER SISTEMA PRÓPRIO DE REFRIGERAÇÃO PARA CONSERVAÇÃO DOS REAGENTES;
TER CAPACIDADE ONBOARD PARA NO MÍNIMO 63 (SESSENTA E TRÊS) REAGENTES REFRIGERADOS;
TER CARROSSEL INTERNO REFRIGERADO PARA AMOSTRAS, CALIBRADORES E CONTROLES;
TER CAPACIDADE PARA NO MÍNIMO 150 AMOSTRAS ONBORD SIMULTANEAMENTE, SENDO QUE NO MÍNIMO 20 AMOSTRAS DEVEM SER DE URGÊNCIA;
TRABALHAR COM AS AMOSTRAS EM SISTEMA DE ESTEIRA;
POSSUIR LEITOR DE CÓDIGO DE BARRAS;
POSSUIR CUBETAS DE REAÇÃO E LEITURA EM QUARTZO, VIDRO, ACRÍLICO OU PLÁSTICO E QUE SEJAM LAVADAS AUTOMATICAMENTE PELOS EQUIPAMENTOS;
SER CAPAZ DE IDENTIFICAR AMOSTRAS SEM E COM CÓDIGO DE BARRAS, COM POSSIBILIDADE DE INTERCALAR AS MESMAS E DE CRIAR UMA LISTA DE TRABALHO;
SER MULTIPARAMÉTRICOS COM CAPACIDADE MÍNIMA PARA REALIZAR 1000 TESTES/HORA/EQUIPAMENTO, INCLUINDO DETERMINAÇÃO DE ELETRÓLITOS, COMPROVADA ATRAVÉS DE CATÁLOGO OU MANUAL DOS EQUIPAMENTOS;
POSSUIR FERRAMENTAS E SOFTWARE DE ANÁLISE DE AMOSTRAS DE CONTROLE DE QUALIDADE COMO, POR EXEMPLO, GRÁFICOS DE LEVEY JENNINGS, CÁLCULO DAS MÉDIAS, DESVIOS PADRÕES E COEFICIENTES DE VARIAÇÃO DAS DETERMINAÇÕES COM POSSIBILIDADE DE VISUALIZAÇÃO EM TELA, ASSIM COMO IMPRESSÃO;
ACEITAR TUBOS DE AMOSTRA DE 5 ML, 7 ML, 10 ML OU CUBETAS, COM DILUIÇÃO AUTOMÁTICA DA AMOSTRA , COM REPETIÇÃO AUTOMÁTICA DA AMOSTRA ORIGINAL OU PRÉ-DILUÍDA, COM ALIMENTAÇÃO CONTÍNUA DE AMOSTRAS NO SISTEMA, COM SENSORES DE BOLHAS E DE VOLUME;
POR QUÍMICA CONVENCIONAL OU QUÍMICA SECA DEVERÁ ACOMPANHAR UMA ESTAÇÃO DE TRATAMENTO QUE FORNEÇA ÁGUA TIPO I QUANDO O EQUIPAMENTO EXIGIR, EM QUANTIDADE SUFICIENTE PARA O FUNCIONAMENTO DOS EQUIPAMENTOS, DEVENDO ACOMPANHAR CONDUTIVÍMETRO DIGITAL ACOPLADO COM ESCALA DECIMAL A PARTIR DE ZERO. POSSUIR SISTEMA DE PREVENÇÃO DE CONTAMINAÇÃO DE REAGENTES E AMOSTRAS.
